const ClientItem=(props)=>{
   
  
    return(
      <>
            <tr>
              <td>{props.client.name}</td>
              <td>{props.client.phone}</td>
              <td>{props.client.email}</td>
              <td>{props.client.company}</td>
              <td>{props.client.role}</td>
              <td>{props.client.description}</td>
            </tr>
        </>
        );
  }
   
  export default ClientItem;
